	add("revanchism", "{\"term\":\"revanchism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027revanchisme\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The political policy of endeavouring to regain lost territory\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, page 233\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fleury had correctly grasped the wisdom of forestalling possible Austrian \u0027\u0027\u0027revanchisme\u0027\u0027\u0027 over Lorraine, while France\u0027s biggest international problems emanated form England\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 November 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The EU lobby may have cobbled together institutions for a united states of Europe, but it was a fool\u0027s errand, and one that could only play into the hands of German \u0027\u0027revanchism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"date\u003d12 September passage\u003dBut couple the tightening of Chinese authoritarianism with Russia\u0027s turn toward \u0027\u0027revanchism\u0027\u0027 and dictatorship, and then add the rise of radical Islam, with its violent intolerance, and the grand victory of Western liberalism can seem hollow, its values under threat even within its own societies\", \"priority\":6}]}, \"synonyms\":{}}");

