	add("reveal", "{\"term\":\"reveal\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027révéler\u0027 from Old french (842-ca. 1400) from Latin \u0027revelare\u0027 (to reveal, uncover) from \u0027re-\u0027 (back, again) + \u0027velare\u0027 (to cover) from \u0027velum\u0027 (veil)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The outer side of a window or door frame; the jamb\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Carter B. Horsley, \u0027The Upper East Side Book\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The building has a one-story rusticated limestone base and a canopied entrance with a doorman beneath an attractive, rusticated limestone window \u0027\u0027reveal\u0027\u0027 on the second floor and a very impressive and ornate limestone window \u0027\u0027reveal\u0027\u0027 on the third floor flanked by female figures\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A revelation; an uncovering of what was hidden\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The comedian had been telling us about his sleep being disturbed by noise. Then came the \u0027\u0027reveal\u0027\u0027: he was sleeping on a bed in a department store\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The side of an opening for a window, doorway, or the like, between the door frame or window frame and the outer surface of the wall; or, where the opening is not filled with a door, etc., the whole thickness of the wall; the jamb\", \"priority\":6}]}, \"synonyms\":{}}");

