	add("revelation", "{\"term\":\"revelation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027revelacion\u0027 from Latin \u0027revēlātiō\u0027 (lang\u003dla) from \u0027revēlō\u0027 (lang\u003dla) \u0027re|lang\u003dla\u0027 () + \u0027vēlō\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of revealing or disclosing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something that is revealed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d7|page\u003d26|magazine\u003d|title\u003d[http://www.theguardian.com/science/2013/jul/01/how-algorithms-rule-world-nsa How algorithms rule the passage\u003dThe use of algorithms in policing is one example of their increasing influence on our lives.who, if anyone, is policing their use[?] Such concerns were sharpened further by the continuing \u0027\u0027revelations\u0027\u0027 about how the US National Security Agency (NSA) has been using algorithms to help it interpret the colossal amounts of data it has collected from its covert dragnet of international telecommunications\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something dramatically disclosed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A manifestation of divine truth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A great success\", \"priority\":6}]}, \"synonyms\":{}}");

