	add("revelry", "{\"term\":\"revelry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Joyful merry-making\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014,\u0027\u0027 , \u0027Blessed. Cursed. Claimed.\u0027, National Geographic (December 2014)[http://ngm.nationalgeographic.com/2014/12/pilgrim-roads/salopek-text\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The women pale and staring under the sun. In plain skirts, drab shoes. In hair scarves. Their drunken \u0027\u0027revelry\u0027\u0027 jars\", \"priority\":3}]}, \"synonyms\":{}}");

	add("revenant", "{\"term\":\"revenant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"19th century. From French \u0027revenant\u0027 the present participle of \u0027revenir\u0027 () Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who returns from a long absence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, Mrs Lynn Linton, \u0027Paston Carew\u0027 viii, as cited in the \u0027Oxford English Dictionary\u0027, volume 8 part 1, published 1914, page 595\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They would not visit this undesirable \u0027\u0027revenant\u0027\u0027 with his insolent wealth and discreditable origin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027 August 31, \u0027Daily News\u0027 4/7, as cited in the \u0027Oxford English Dictionary\u0027, volume 8 part 1, published 1914, page 595\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The undergraduates, our fogey \u0027\u0027revenant\u0027\u0027 observes, look much as they did.., in outward aspect\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Andrew Cusack, \u0027Wanderer in 19th-Century German Literature\u0027, Camden House, ISBN 978-1-57113-386-1, [http://books.google.com/books?id\u003ddUxP7mCgUv8C\u0026amp;pg\u003dPA91\u0026amp;dq\u003drevenant page 91\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"From this moment on, the hero\u0027s fate is sealed; an attempt to reestablish himself in human society, though initially successful, inevitably fails. The stone tablet exerts an invincible fascination over the \u0027\u0027revenant\u0027\u0027, who becomes so withdrawn that his father implores him\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person or thing reborn\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, John Burrow, \u0027A History of Histories\u0027, Penguin 2009, page 184\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Sometimes semi-identifications could be made on the basis of names. Henry VII\u0027s son Arthur was hailed as a \u0027\u0027revenant\u0027\u0027 in this way\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A supernatural being that returns from the dead; a zombie or ghost\", \"priority\":11}]}, \"synonyms\":{}}");

	add("revengement", "{\"term\":\"revengement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|revenge|ment|lang\u003den}}, or {{prefix|re|vengement|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Revenge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With that he drives at them with dreadfull might, / Both in remembrance of his friends late harme, / And in \u0027\u0027revengement\u0027\u0027 of his owne despight […\", \"priority\":3}]}, \"synonyms\":{}}");

