	add("revisor", "{\"term\":\"revisor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|revise|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who verifies the quality of a translated text in professional translation project management\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Christiane Nord, \u0027Training for the New Millennium: Pedagogies for translation and interpreting\u0027, edited by Martha Tennent, Benjamins Translation Library, p. 218\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"T]ranslation practice during training should, at least in part, be organised in projects where each student has the chance to play various roles: that of client, of \u0027\u0027revisor\u0027\u0027, of terminologist of documentation assistant, of free-lancer, of in-house translator working for a translation company, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In several states, an official charged with the responsibility for making new statutes technically consistent with the existing body of law\", \"priority\":4}]}, \"synonyms\":{}}");

