	add("revolution", "{\"term\":\"revolution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027reuolucion\u0027 from Old french (842-ca. 1400) \u0027revolution\u0027 from \u0027revolūtiōnem\u0027 accusative singular of \u0027revolūtiō\u0027 (the act of revolving; revolution) from Latin \u0027revolvō\u0027 (roll back, revolve) see revolve.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political upheaval in a government or nation state characterized by great change\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The removal and replacement of a government\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Rotation: the turning of an object around an axis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, P. M. Heldt, \u0027The Gasoline Automobile: Its Design and Construction, Volume II: Transmission, Running Gear and Control\u0027, The Horseless Age Co. (1913), [http://books.google.com/books?id\u003dgqo7AAAAMAAJ\u0026amp;pg\u003dPA147\u0026amp;dq\u003drevolution page 147\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ratio between the speeds of \u0027\u0027revolution\u0027\u0027 of wheel and disc is substantially equal to the reciprocal of the ratio between the diameter of the wheel and the diameter of the mean contact circle on the disc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A rotation: one complete turn of an object during rotation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1864\u0027\u0027, D. M. Warren, \u0027The Common-School Geography\u0027, Revised Edition, H. Cowperthwait \u0026amp; Co., [http://books.google.com/books?id\u003dmeI-AAAAYAAJ\u0026amp;pg\u003dPA6\u0026amp;dq\u003drevolution page 6\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Earth has two motions: a daily \u0027\u0027revolution\u0027\u0027 (or turning around) upon its \u0027axis\u0027, and a yearly course around the sun\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1878\u0027\u0027, George Fleming, \u0027A Text-Book of Veterinary Obstetrics\u0027, Baillière, Tindall, \u0026amp; Cox, [http://books.google.com/books?id\u003dMUQDAAAAQAAJ\u0026amp;pg\u003dPA123\u0026amp;dq\u003drevolution page 123\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Numerous cases are recorded which incontestibly prove that during pregnancy, the uterus perform \u0026lt;!-- [sic] not \u0026quot;performs\u0026quot;; somehow subjunctive, maybe? --\u0026gt; a half or even a complete \u0027\u0027revolution\u0027\u0027, on itself, producing torsion of the cervix\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In the case of celestial celestial bodies - the traversal of one body through an orbit around another body\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A sudden, vast change in a situation, a discipline, or the way of thinking and behaving\", \"priority\":12}]}, \"synonyms\":{}}");

	add("revolutionariness", "{\"term\":\"revolutionariness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|revolutionary|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being revolutionary\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, Christopher Hill, \u0027Puritanism \u0026amp; Revolution: Studies in Interpretation of the English Revolution of the 17th Century\u0027, Pimlico (2001), ISBN 0712667229, [http://books.google.com/books?id\u003duAFFpInTuSUC\u0026amp;pg\u003dPT159\u0026amp;dq\u003d%22revolutionariness%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22revolutionariness%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His environment and mode of life may have aligned him with the old order politically; but none can deny the \u0027\u0027revolutionariness\u0027\u0027 of his method, of his criticism, the boldness of his rejections\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Jones Irwin, \u0027Derrida and the Writing of the Body\u0027, Ashgate (2010), ISBN 9780754678656, [http://books.google.com/books?id\u003d5fDKO4Gn3PUC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22revolutionariness%22 page 55\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It also demonstrates the innovativeness and \u0027\u0027revolutionariness\u0027\u0027 of Mallarme\u0027s approach which is here being put to work by Derrida\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Ivana Zagorac, \u0026quot;St. Francis of Assisi: Bioethics in European Middle Ages\u0026quot;, in \u0027Fritz Jahr and the Foundations of Global Bioethics: The Future of Integrative Bioethics\u0027 (eds. Amir Muzur \u0026amp; Hans-Martin Sass), Lit (2012), ISBN 9783643901125, [http://books.google.com/books?id\u003dNdw2GXCy-IsC\u0026amp;pg\u003dPA74\u0026amp;dq\u003d%22revolutionariness%22 page 74\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027revolutionariness\u0027\u0027 of St. Francis\u0027s individualistic approach is especially evident in the historical context within which it developed\", \"priority\":8}]}, \"synonyms\":{}}");

	add("revolutionarity", "{\"term\":\"revolutionarity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|revolutionary|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being revolutionary\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027, D. Mackenzie Wallace, \u0026quot;Secret Societies in Russia\u0026quot;, \u0027Eclectic Magazine of Foreign Literature, Science, and Art\u0027, Volume XXVI, Number 4, October 1887, [http://books.google.com/books?id\u003ddrsmAQAAIAAJ\u0026amp;pg\u003dPA398\u0026amp;dq\u003d%22revolutionarity%22 page 398\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Revolutionarity\u0027\u0027 can exist only in the feelings of an individual man or in the periodical outbursts of the masses\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, \u0027Praxis\u0027, Volume 1, [http://books.google.com/books?id\u003dJt0nAQAAIAAJ\u0026amp;q\u003d%22revolutionarity%22 page 54\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is, likewise, no philosophy nor any major theoretical venture in history which, irrespective of its \u0027\u0027revolutionarity\u0027\u0027, is totally free of the authority of tradition\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, \u0027Maximum Rocknroll\u0027, Issue 19, [http://books.google.com/books?id\u003dGQZbAAAAMAAJ\u0026amp;q\u003d%22revolutionarity%22\u0026amp;dq\u003d%22revolutionarity%22 unknown page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If you do whatever the masses don\u0027t do or the minority does, you\u0027re just as mindless a conformist follower as they are. How revolutionary?! CRASS, M.D.C., and the Yippies are probably just suggesting a better lifestyle to be considered, not step-by-step instructions to \u0027\u0027revolutionarity\", \"priority\":7}]}, \"synonyms\":{}}");

	add("revolutioner", "{\"term\":\"revolutioner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|revolution|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who engages in bringing about a revolution; a revolutionary\", \"priority\":1}]}, \"synonyms\":{}}");

	add("revolver", "{\"term\":\"revolver\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|en|revolver|lang\u003dcrh}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Le Mat thumb|A revolve\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A handgun with a revolving chamber enabling several shots to be fired without reloading\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"by extension, any (personal) firearm with such a mechanis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"agent Agent noun of revolve; something that revolves\", \"priority\":4}]}, \"synonyms\":{}}");

	add("revote", "{\"term\":\"revote\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|vote|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of voting agai\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the rigors of caucusing, which can require hours of votes and \u0027\u0027revotes\", \"priority\":2}]}, \"synonyms\":{}}");

